import React from "react";
import { AiOutlineLogout } from "react-icons/ai";
export default function Footer() {
  return (
    <nav id="bottomNav">
      <div
        style={{
          flex: 1,
          display: "flex",
          alignItems: "center",
        }}
      >
        <div className="navButton">USER</div>
      </div>
      <input type="text" />
      <div
        style={{
          flex: 1,
          display: "flex",
          alignItems: "center",
          justifyContent: "flex-end",
        }}
      >
        <div className="navButton">BUTTONS</div>
      </div>
    </nav>
  );
}
